module.exports = "<h1 id=\"-yelik\">yelik</h1>\n<p>BitShares&#39;deki hesaplar  gruba ayrlrlar . Biz kullanclara dilerlerse hesaplarn VIP\ngibi bir statye ykseltmelerine ve ilave zelliklerden ve indirimlerden \nfaydalanmalarna imkan tandk.</p>\n<h2 id=\"-ye-olmayanlar\">ye-Olmayanlar</h2>\n<p><em>Normal</em>  hesap <em>ye-olmayan</em> bir hesaptr.</p>\n<h2 id=\"-m-r-boyu-yeler\">mr-boyu yeler</h2>\n<p>mr-boyu-yelerinin dedii her ilem cretinin belirli bir yzdesi kendilerine iade \nedilir ve kaydn yaptklar ya da getirdikleri yelerden komisyon geliri kazanmaya \nhak kazanrlar. mr-boyu-yelikle alakal kurul tarafndan belirlenmi belli miktarda \ntek-seferlik bir cret vardr.</p>\n<h2 id=\"y-ll-k-yeler\">Yllk yeler</h2>\n<p>mr-boyu-yelik eer ok fazla gelirse , bir yl sreli tek-seferlik dk bir bedel \nkarlnda yllk abone olarak bir sonraki seneye de ayn iadeyi \nalabilirsiniz.</p>\n<h3 id=\"-cret-payla-m-\">cret Paylam</h3>\n<p>Getirdiiniz hesap her ilem creti dediinde o cret birok farkl hesap arasnda \npay edilir. Amz bir ksmn alr , hesab getiren mr-boyu-ye de dier ksmn alr.\nHesab getiren ye bir ksm pay alr.</p>\n<p>Kayt , hesabn amza kayd yaplrken ilem cretini deyen hesaptr. Kayt \ncretin geri kalan ksmn kendisi ve balantlaryla nasl pay edeceine kendisi karar \nverir.</p>\n<h3 id=\"bekleyen-cretler\">Bekleyen cretler</h3>\n<p>denen cretler sadece amz, getirenler, ve kaytlar arasnda her bakm aralnda \nbir kez pay edilir.</p>\n<h3 id=\"hak-edilen-cretler\">Hak Edilen cretler</h3>\n<p>ou cretler annda denmesine ramen , bir limitin zerindeki cretler (mesela \nyeliinizi ykseltmek iin dediiniz ya da paral hesap kaydetmek iin dediiniz \ncretler) kurul tarafndan belirlenen bir ka gn boyunca haciz altnda tutulabilirler.</p>\n";

