module.exports = "<h1 id=\"bitaktif-k-sa-sat-\">BitAktif Ksa Sat</h1>\n<p>BTS&#39;le temasnz arttrmak ve USD,EUR,GOLD gibi BitAktiflere likidite salamak iin \nbu BitAktifleri adan <em>dn</em> alabilir ve <em>ksa satabilirsiniz</em>. Prosedr burada ksaca \nanlatacaz.</p>\n<h2 id=\"-d-n-alma\">dn Alma</h2>\n<p>BitShares ann herhangi bir miktarda BitVarl piyasaya srmesi ve yeterli teminat \nkarlnda katlmclara bor vermesi mmkndr. </p>\n<ul>\n<li><em>uzlama fiyat</em> : 1 BTS in d borsalarda alp-satlrkenki fiyat.</li>\n<li><em>idame teminat oran</em> (MCR) :  zorunlu minimum teminat oran </li>\n<li><em>maksimum ksa sktrma oran</em> (MSQR) : Tanklar tarafndan ksalarn ksa sktrmalara kar nereye kadar korunacaklarn belirleyen oran.</li>\n<li><em>ksa sktrmadan korunma</em> (SQP) : Marjin pozisyonuna dettirilebilecek en yksek  </li>\n<li><em>ar fiyat</em> (cp):   Ksa/dn pozisyonlarnn marjin arld fiyat.  </li>\n</ul>\n<h3 id=\"marjin-a-r-s-teminat-tamamlama-a-r-s-\">Marjin ars ( Teminat Tamamlama ars)</h3>\n<p>BitShares a , dn ald bitVarln karlnda yeterince teminat bulunmayan \npozisyonlar teminat tamamlamalar iin arabilir. Marjin ars , en yksek al fiyat \nteklifinin <em>ar fiyatndan</em> az , ve <em>SQP</em> dan byk olduu herhangi bir anda \nmeydana gelebilir.\nMarjin pozisyonu, teminat satn almaya verilen en yksek teklifin ar \nfiyatndan(x/BTS) daha dk olduu anda teminat zorla sattrlr.</p>\n<pre><code>SQP =  uzlama fiyat / MSQR\nar fiyat = BOR / TEMNAT * MCR\n</code></pre><p>Marjin ars teminat alr , dn alnm bitaktif hisselerinin SQP ya kadarki ksmn\npiyasa fiyatndan satn alr ve pozisyonu kapar. Teminattan geri kalan BTS mteriye \niade edilir.</p>\n<h3 id=\"hesap-g-rme\">Hesap grme</h3>\n<p>Her bitaktif sahibi istedii zaman <em>adil bir fiyattan</em> hesap grmeyi talep edebilir.\nHesap grme ilemi, dn/ksa pozisyonlarn en dk teminat oranyla kapar ve \nhesap grmek zere teminat satar.</p>\n<h2 id=\"sat-\">Sat</h2>\n<p>BitAktif dn alndktan sonra alakal piyasalardan herhangi birinde herhangi\nbir fiyattan satlabilir . Bu aamayla ,  ksa-sat tamamlanm olur ve o bitaktif da ksa \nolursunuz.</p>\n<h2 id=\"teminat-oran-n-g-ncellemek\">Teminat Orann Gncellemek</h2>\n<p>dn/ksa pozisyonu tutan kii , herhangi bir zamanda , piyasa \ndavrann esnek bir biimde ayarlamak iin teminat orann deitirebilir. Eer \nteminat oran arttrlrsa , ilave miktarda BTS teminat olarak kilit altna alnr, teminat \norannn drlmesi ise tekabl eden miktarda BitVarln aa geri denmesini \ngerektirir.</p>\n<h2 id=\"kapamak\">Kapamak</h2>\n<p>dn/ksa pozisyonunu kapamak iin , ilk nce kiinin , BitShares ana teslim \netmek zere o Bitvarln dn alnan miktarda elinde bulunmas gerekir. Ondan \nsonra , BitAktifler arz stoundan der ve teminat serbest braklp sahibine geri \nverilir.</p>\n";

